function Person({ person }) {
  return (
    <div className="card shadow m-3">
      <div className="card-body">
        <h4 className="card-title headline">{person.headline}</h4>
        <h6 className="text-nuted card-subtitle">Cuba</h6>
        <span className="badge badge-primary topic-badge">Economy</span>
      </div>
    </div>
  );
}

